import{_ as e,c as r,o as a,V as t}from"./chunks/framework.fZt_wkQb.js";const d=JSON.parse('{"title":"This is High Ping Network Official Website","description":"","frontmatter":{},"headers":[],"relativePath":"aboutus.md","filePath":"aboutus.md"}'),i={name:"aboutus.md"},l=t('<h1 id="this-is-high-ping-network-official-website" tabindex="-1">This is High Ping Network Official Website <a class="header-anchor" href="#this-is-high-ping-network-official-website" aria-label="Permalink to &quot;This is High Ping Network Official Website&quot;">​</a></h1><p>Hi! 这里是 <code>High Ping Network</code> 的官方网站</p><p><code>High Ping Network</code> 的 ASN 为 <a href="https://bgp.he.net/AS215575" target="_blank" rel="noreferrer">AS215575</a></p><p>2024.02.05 必然是个值得令我们纪念的日子，我们终于拿到了我们心心念念的 ASN</p><h2 id="基本成员" tabindex="-1">基本成员 <a class="header-anchor" href="#基本成员" aria-label="Permalink to &quot;基本成员&quot;">​</a></h2><p>我们是由 11 个人组成的小团队：(按照首字母顺序排列)</p><ul><li><a href="https://t.me/C1oudF1are" target="_blank" rel="noreferrer">@GenshinMinecraft</a></li><li><a href="https://t.me/HighPingKat" target="_blank" rel="noreferrer">@HighPingKat</a></li><li><a href="https://t.me/cn_imkcp" target="_blank" rel="noreferrer">@imkcp</a></li><li><a href="https://t.me/Lemonawa" target="_blank" rel="noreferrer">@Lemonawa</a></li><li><a href="https://t.me/Lengz1m0" target="_blank" rel="noreferrer">@Lengz1m0</a></li><li><a href="https://t.me/Akiyama_mio_hi" target="_blank" rel="noreferrer">@Mio</a></li><li><a href="https://t.me/CNVET" target="_blank" rel="noreferrer">@re:NoAries</a></li><li><a href="https://t.me/rtx5000ada" target="_blank" rel="noreferrer">@rtx ςαΤ</a></li><li><a href="https://t.me/samandjyf1" target="_blank" rel="noreferrer">@sam</a></li><li><a href="https://t.me/dann2333" target="_blank" rel="noreferrer">@Toothless</a></li><li><a href="https://t.me/UniOreoX" target="_blank" rel="noreferrer">@UniOreoX</a></li></ul><h2 id="我们的信息" tabindex="-1">我们的信息 <a class="header-anchor" href="#我们的信息" aria-label="Permalink to &quot;我们的信息&quot;">​</a></h2><ul><li>关于我们: <a href="https://highp.ing/aboutus.html" target="_blank" rel="noreferrer">https://highp.ing/aboutus.html</a></li><li>我们的官网: <a href="https://highp.ing" target="_blank" rel="noreferrer">https://highp.ing</a></li><li>我们的博客: <a href="https://blog.highp.ing" target="_blank" rel="noreferrer">https://blog.highp.ing</a></li><li>我们的官方邮箱: <a href="mailto:noc@highp.ing" target="_blank" rel="noreferrer">noc@highp.ing</a></li><li>我们的投诉邮箱: <a href="mailto:abuse@highp.ing" target="_blank" rel="noreferrer">abuse@highp.ing</a></li><li>我们的 Telegram 频道: <a href="https://t.me/HighPingNetwork" target="_blank" rel="noreferrer">@HighPingNetwork</a></li><li>我们的 Telegram 群组: <a href="https://t.me/highpingchat" target="_blank" rel="noreferrer">@HighPingChat</a></li></ul><h2 id="特别鸣谢" tabindex="-1">特别鸣谢 <a class="header-anchor" href="#特别鸣谢" aria-label="Permalink to &quot;特别鸣谢&quot;">​</a></h2><ul><li><a href="https://zhnet.co.uk/" target="_blank" rel="noreferrer">zhnet</a> -- 我们的 LIR</li><li><a href="https://t.me/gugumnt" target="_blank" rel="noreferrer">Rinne</a> -- zhnet 的一员，为我们提供了很多的帮助与服务</li><li><a href="https://cloudflare.com" target="_blank" rel="noreferrer">Cloudflare</a>: 提供了 Cloudflare Pages 等服务支撑我们<strong>官网</strong>以及<strong>博客</strong>的搭建，同时 DNS、CDN 等服务都极度依赖于 Cloudflare</li><li><a href="https://port.moonport.top/" target="_blank" rel="noreferrer">虚妄猫</a>: 提供了<em>面向中国大陆</em>的博客托管<strong>免费虚拟主机</strong> <a href="https://nomao.blog.highp.ing" target="_blank" rel="noreferrer">https://nomao.blog.highp.ing</a></li><li><a href="https://github.com" target="_blank" rel="noreferrer">Github</a>: 提供了 Git 托管服务，为我们的编辑以及项目开发提供了<strong>基础平台</strong></li><li><a href="http://shiroaudio.eu.org" target="_blank" rel="noreferrer">Shiro Atelier</a>: 为我们设计了视觉形象，有关于我们的 Logo 欢迎参观<a href="https://blog.highp.ing/p/newlogo/" target="_blank" rel="noreferrer">博客相关内容</a></li></ul><h2 id="我们的-ip-ranges" tabindex="-1">我们的 IP Ranges <a class="header-anchor" href="#我们的-ip-ranges" aria-label="Permalink to &quot;我们的 IP Ranges&quot;">​</a></h2><p>目前，我们只有 IPv6 <s>(说白了就是没钱买 IPv4</s></p><p>我们的 IPv6 Ranges 为 <code>2a0f:7803:fb20::/44</code></p><ul><li>起-始: <code>2a0f:7803:fb20:0000:0000:0000:0000:0000</code>-<code>2a0f:7803:fb2f:ffff:ffff:ffff:ffff:ffff</code></li><li>CIDR: <code>2a0f:7803:fb20::/44</code></li><li>总计 IP 数量: <code>19,342,813,113,834,066,795,298,816</code>个可用 IPv6 地址</li></ul><p>用人话来说，就是约有 19 亿亿亿个 IPv6，用十辈子都用不完（</p><p>我们的分配 (将一个 /44 平均分成 16 等份，每份为 /48，剩余5个为备用段):</p><ul><li>2a0f:7803:fb20::/48 -- <a href="https://t.me/rtx5000ada" target="_blank" rel="noreferrer">@rtx ςαΤ</a></li><li>2a0f:7803:fb21::/48 -- <a href="https://t.me/samandjyf1" target="_blank" rel="noreferrer">@sam</a></li><li>2a0f:7803:fb22::/48 -- <a href="https://t.me/UniOreoX" target="_blank" rel="noreferrer">@UniOreoX</a></li><li>2a0f:7803:fb23::/48 --</li><li>2a0f:7803:fb24::/48 -- <a href="https://t.me/C1oudF1are" target="_blank" rel="noreferrer">@GenshinMinecraft</a></li><li>2a0f:7803:fb25::/48 -- <a href="https://t.me/Lemonawa" target="_blank" rel="noreferrer">@Lemonawa</a></li><li>2a0f:7803:fb26::/48 --</li><li>2a0f:7803:fb27::/48 -- <a href="https://t.me/Lengz1m0" target="_blank" rel="noreferrer">@Lengz1m0</a></li><li>2a0f:7803:fb28::/48 -- <a href="https://t.me/cn_imkcp" target="_blank" rel="noreferrer">@imkcp</a></li><li>2a0f:7803:fb29::/48 --</li><li>2a0f:7803:fb2a::/48 -- <a href="https://t.me/dann2333" target="_blank" rel="noreferrer">@Toothless</a></li><li>2a0f:7803:fb2b::/48 -- <a href="https://t.me/HighPingKat" target="_blank" rel="noreferrer">@HighPingKat</a></li><li>2a0f:7803:fb2c::/48 -- <a href="https://t.me/CNVET" target="_blank" rel="noreferrer">@re:NoAries</a></li><li>2a0f:7803:fb2d::/48 --</li><li>2a0f:7803:fb2e::/48 --</li><li>2a0f:7803:fb2f::/48 -- <a href="https://t.me/Akiyama_mio_hi" target="_blank" rel="noreferrer">@Mio</a></li></ul><h2 id="high-ping-network-这一名称的由来" tabindex="-1">High Ping Network 这一名称的由来 <a class="header-anchor" href="#high-ping-network-这一名称的由来" aria-label="Permalink to &quot;High Ping Network 这一名称的由来&quot;">​</a></h2><p><code>High Ping</code> 的意思是 <strong>延迟高</strong>，所以 <code>High Ping Network</code> 的意思就是 <strong>延迟很高的网络</strong></p><p>这一名字具有<em><strong>自嘲</strong></em>与<em><strong>搞笑</strong></em>的特点，并在<strong>我们的投票中</strong>胜出</p><p><img src="https://i.miji.bid/2024/01/01/4cac034a8cb3b84cef52931f1bbcbfd7.png" alt="4cac034a8cb3b84cef52931f1bbcbfd7.png"></p><p>由于不希望让 ASN Name 变得那么长，所以我们将 <code>High Ping Network</code> 中的 <code>Network</code> 删去了</p><h2 id="love" tabindex="-1">Love <a class="header-anchor" href="#love" aria-label="Permalink to &quot;Love&quot;">​</a></h2><p>我们因热爱互联网而走到一起，可能我们的出现并不会在互联网激起什么水花，但我们仍乐在其中</p><h3 id="q-a" tabindex="-1">Q&amp;A <a class="header-anchor" href="#q-a" aria-label="Permalink to &quot;Q&amp;A&quot;">​</a></h3><blockquote><p>Q: 为什么要整一个 ASN? A: 在之前，我们初次接触到了 DN42 网络，但是觉得在这样一个小众的圈子内不怎么好玩，所以产生了一个大胆的想法，那就是 <strong>整一个ASN!</strong></p></blockquote><blockquote><p>Q: 将来这个 ASN 会用来干什么?<br> A: 这个问题...我们也许没有答案。由于我们的 IP 段是平均分给每一位成员的，所以只要不违反道德以及法律底线，我们都可以接受。</p></blockquote><blockquote><p>Q: ASN 的花费?<br> A: 从头到尾，我们在该 ASN 上约花费了 700CNY，包括了 zhnet 的公司代注册以及 Lir，还有一个域名 <code>highp.ing</code>。加起来还有剩余，所以你可以看到，一个 ASN 也不是那么的贵。</p></blockquote><h3 id="dn42" tabindex="-1">DN42 <a class="header-anchor" href="#dn42" aria-label="Permalink to &quot;DN42&quot;">​</a></h3><p>我们是从 DN42 出来的，当然欢迎来 DN42 Peer</p><p>我们有一部分的人有自己的 DN42 ASN:</p><ul><li><a href="https://t.me/C1oudF1are" target="_blank" rel="noreferrer">GenshinMinecraft</a>: AS4242421304</li><li><a href="https://t.me/samandjyf1" target="_blank" rel="noreferrer">sam</a>: AS4242422503</li><li><a href="https://t.me/Akiyama_mio_hi" target="_blank" rel="noreferrer">Mio</a>: AS4242422406</li><li><a href="https://t.me/rtx5000ada" target="_blank" rel="noreferrer">rtx ςαΤ</a>: AS4242423608</li></ul><p>如果您想要与我们在 DN42 中 Peer，可以通过上方的链接找到我们!</p><h2 id="open-source" tabindex="-1">Open-Source <a class="header-anchor" href="#open-source" aria-label="Permalink to &quot;Open-Source&quot;">​</a></h2><p>我们热爱开源，从我们网站大致就可以看出</p><p>同时非常感谢为<strong>开源项目</strong>做出贡献的<strong>每一位</strong>开源人！</p><ul><li>官网 <a href="https://highp.ing" target="_blank" rel="noreferrer">https://highp.ing</a> : <a href="https://vitepress.dev/" target="_blank" rel="noreferrer">Vitepress</a></li><li>博客 <a href="https://blog.highp.ing" target="_blank" rel="noreferrer">https://blog.highp.ing</a> : <a href="https://gohugo.io/" target="_blank" rel="noreferrer">Hugo</a></li></ul><h2 id="glad-to-meet-you-the-internet" tabindex="-1">Glad To Meet You, The Internet! <a class="header-anchor" href="#glad-to-meet-you-the-internet" aria-label="Permalink to &quot;Glad To Meet You, The Internet!&quot;">​</a></h2><p><code>WE LOVE OPEN-SOURCE</code></p><p>这句话，出自于 Arduino。如果你曾经买过 Arduino 的开发板，那你应该会发现开发板的盒子上都会印着这句话。这句话也是我们某位成员的座右铭</p><blockquote><p>我们因热爱互联网而走到一起，可能我们的出现并不会在互联网激起什么水花，但我们仍乐在其中</p></blockquote><p>正如 <strong>《我家跨上了“信息高速路”》</strong> 那篇课文，我们这一次是真正地跨上了 <strong>信息高速路</strong></p><blockquote><p>它就像一个遍布全球的巨大蜘蛛网，把每一个国家、每一个城市甚至每一个家庭连接到一起。</p></blockquote><p>我们没有那么远大的理想将全世界都连接到一起，但是我们可以让我们自身与朋友连接在一起，That enough!</p>',45),o=[l];function n(h,f,g,s,p,b){return a(),r("div",null,o)}const m=e(i,[["render",n]]);export{d as __pageData,m as default};
